//Runtime: 264 ms, faster than 64.19% of C++ online submissions for All Elements in Two Binary Search Trees.
//Memory Usage : 94.1 MB, less than 5.81% of C++ online submissions for All Elements in Two Binary Search Trees.
class Solution {
public:

	list<int> traverse(TreeNode* root) {
		list<int> result;

		stack<pair<TreeNode*, list<int>::iterator>> toVisit;
		if (root)
			toVisit.emplace(root, end(result));
		while (!toVisit.empty()) {
			auto n = toVisit.top();
			toVisit.pop();
			auto ci = result.insert(n.second, n.first->val);
			auto cl = ci, cr = ci;
			cr++;
			if (n.first->left)
				toVisit.emplace(n.first->left, cl);
			if (n.first->right)
				toVisit.emplace(n.first->right, cr);
		}
		
		return result;
	}

	vector<int> getAllElements(TreeNode* root1, TreeNode* root2) {
		auto l1 = traverse(root1);
		auto l2 = traverse(root2);
		vector<int> result;
		result.reserve(l1.size() + l2.size());

		auto i1 = begin(l1), e1 = end(l1);
		auto i2 = begin(l2), e2 = end(l2);

		while (i1 != e1 && i2 != e2) {
			if (*i1 <= *i2)
				result.push_back(*i1++);
			else
				result.push_back(*i2++);
		}

		while (i1 != e1)
			result.push_back(*i1++);

		while (i2 != e2)
			result.push_back(*i2++);

		return result;
	}
};

